  render() {
    return (
      <Grid columns={2} relaxed="very" style={{ height: "20vh" }}>
        <Grid.Column verticalAlign="middle" textAlign="center" width={5}>
          <Grid.Row>
            <Image src={image} circular size="tiny" centered />
          </Grid.Row>
          <Grid.Row>
            <h2> About Me </h2>
          </Grid.Row>
        </Grid.Column>
        <Grid.Column verticalAlign="middle" textAlign="left" width={11}>
          <font size="5">
            My name is Timothy Bell and I am 21 years old. I am currently a
            junior at Texas Tech University working towards my bachelorâ€™s in
            computer science and a minor in Mathematics. I was born in Seattle,
            Washington and currently reside in Lubbock, Texas for school.
          </font>
        </Grid.Column>
      </Grid>
    );
  }
}

export default About;
